import React from 'react'
import {Row, Col} from 'react-bootstrap'

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {value: ''}

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    handleSubmit(event) {
        alert ('A name was submitted: ' + this.state.value);
        event.preventDefault();
    }

    render() {
        return (
        <Row className="justify-content-center">
            <form onSubmit={this.handleSubmit}>
                <label>
                Your Input <br />
                Request to Server Response from Server<br />
                <Col>
                    <input type="name" value={this.state.value} onChange={this.handleChange} name="name" placeholder="Enter name"/>
                </Col>
                <Col>
                    <input type="ans" value={this.state.value} onChange={this.handleChange} name="ans"/>
                </Col>
                </label>
            </form>
        </Row>

        );
    }
}

export default Home;
